// The code below shows an example of how to instantiate this type.
// The values are placeholders you should change.
using Amazon.CDK.AWS.CodeGuruProfiler;

var agentPermissions;

CfnProfilingGroup cfnProfilingGroup = new CfnProfilingGroup(this, "MyCfnProfilingGroup", new CfnProfilingGroupProps {
    ProfilingGroupName = "profilingGroupName",

    // the properties below are optional
    AgentPermissions = agentPermissions,
    AnomalyDetectionNotificationConfiguration = new [] { new ChannelProperty {
        ChannelUri = "channelUri",

        // the properties below are optional
        ChannelId = "channelId"
    } },
    ComputePlatform = "computePlatform",
    Tags = new [] { new CfnTag {
        Key = "key",
        Value = "value"
    } }
});

java.source:
// The code below shows an example of how to instantiate this type.
// The values are placeholders you should change.
import software.amazon.awscdk.services.codeguruprofiler.*;

Object agentPermissions;

CfnProfilingGroup cfnProfilingGroup = CfnProfilingGroup.Builder.create(this, "MyCfnProfilingGroup")
        .profilingGroupName("profilingGroupName")

        // the properties below are optional
        .agentPermissions(agentPermissions)
        .anomalyDetectionNotificationConfiguration(List.of(ChannelProperty.builder()
                .channelUri("channelUri")

                // the properties below are optional
                .channelId("channelId")
                .build()))
        .computePlatform("computePlatform")
        .tags(List.of(CfnTag.builder()
                .key("key")
                .value("value")
                .build()))
        .build();

